import React from "react";

const UseEffect = () => {
  return (
    <div className="container-fluid">
      <div className="header text-center display-6  text-bg-dark">
        Effect Example
      </div>
      <button className="btn btn-primary mt-">
        +
      </button>
    </div>
  );
};

export default UseEffect;
